INSERT INTO `email_templates` (`id`, `email_template_title`, `email_template_sender_name`, `email_template_sender_email_address`, `email_template_email_address`, `email_template_email_heading`, `email_template_email_from`, `email_template_subject`, `email_template_description`, `email_template_support_message`, `email_template_disclaimer`, `email_template_status`, `created`, `modified`) VALUES
(1, 'Admin Forgot Password', 'mysite.com', 'info@mysite.com', 'manish9384@gmail.com', 'Forgot Password', 'Best regards,\r\n\r\nThe mysite Team', 'Retrieve Your Password ', 'Trouble logging in? We can help! Use this handy dandy button to update your password. It’s super easy! \r\n\r\n<tr>\r\n  <td colspan=\"2\" style=\"padding:0 15px 20px;vertical-align:top;\">\r\n     <table style=\"width:100%; border:1px solid #d3d3d3;border-collapse: separate; border-spacing:0;\" aria-describedby=\"mydesc\">\r\n       <tr>\r\n           <th scope=\"col\" colspan=\"2\" style=\"text-align:left; padding:7px 18px; font-family:Verdana, Geneva, sans-serif; color:#fff; font-size:14px;font-weight:400; background:#424242;\">Password Details</th>\r\n         </tr>\r\n         <tr>\r\n          <th scope=\"col\" style=\"text-align:left; width:230px;padding:10px 15px;font-family:Verdana, Geneva, sans-serif; color:#424242; font-size:13px; font-weight:bold;border-bottom:1px solid #d3d3d3;\">Password:</th>\r\n            <td style=\"padding:10px 15px;font-family:Verdana, Geneva, sans-serif; color:#424242; font-size:13px; font-weight:400;border-bottom:1px solid #d3d3d3;\">[PASSWORD]</td>\r\n        </tr>\r\n        \r\n      </table>\r\n  </td>\r\n</tr>\r\n\r\nPlease note: If you haven’t recently tried to log in to your account, fear not! Your password is safe, and you can delete this email.\r\n', 'If you have any questions, please don’t hesitate to get in touch at test@mysite.com.', 'The information transmitted is intended only for the person or entity to which it is addressed and may contain confidential and/or privileged material. Any review, transmission, re-transmission, dissemination or other use of, or taking of any action in reliance upon this information, by persons or entities other than the intended recipient, is prohibited. If you received this email in error, please contact the sender and delete the material from any computer.', 1, '1431137790', '1431137790');
