(3, 'Content', 'Cookies', NULL, 'Cookie Policy\r\n\r\nRIFF FILM CLUB  (\"we\", \"us\", \"Cinemasthan\") understands that your privacy is important to data subject (\"you\", \"your\", \"user\", \"subscriber\") and we are committed for being transparent about the technologies we use. This Cookie Policy explains how and why cookies and other similar technologies may be stored on and accessed from your device when you use or visit CINEMASTHAN website or application that posts a link to this Policy (collectively, \"the Sites\"). This Cookie Policy should be read together with our Privacy Policy and Terms of Use.\r\n\r\nBy continuing to browse or use our Sites, you agree that we can store and access Cookies and Other Tracking Technologies as described in this Cookie Policy.\r\n\r\nWe use the following types of cookies:\r\n\r\na. Persistent Cookies.\r\nWe use persistent cookies to improve your experience of using the sites. This includes recording your acceptance of our Cookie Policy to remove the cookie message which first appears when you visit the site.\r\n\r\nb. Session Cookies.\r\nSession Cookies are temporary and deleted from your machine when your web browser closes. We use session Cookies to help us track internet usage as described above.\r\n\r\nYou may refuse to accept browser Cookies by activating the appropriate setting on your browser. However, if you select this setting you may be unable to access certain parts of the Sites. Unless you have adjusted your browser setting so that it will refuse Cookies, our system will check if Cookies can be captured when you direct your browser to our Sites.\r\n\r\nThe data collected by the sites and/or through cookies that may be placed on your computer will not be kept for longer than is necessary to fulfil the purposes mentioned above. In any event, such information will not be kept for longer than 90 days.\r\n\r\nHow do I refuse or withdraw my consent to the use of Cookies?\r\n\r\nIf you do not want Cookies to be dropped 