(5, 'Content', 'About Us', NULL, 'Cinemasthan is an Online Over The Top (OTT) video streaming platform initiated by RIFF Film Club.\r\n\r\nCinemasthan primarily focuses on the Rajasthani Language content and also offers Short Films, Music Video Albums, Feature films, Documentary Films, Animation Films & Regional Films from India and abroad. Cinemasthan is the first Rajasthan\'s own OTT Platform which has a highly evolved video streaming technology and high attention to the quality of experience across various devices and platforms, \r\n\r\nCinemasthan\'s video streaming technology ensures that the best possible video quality is played back automatically based on the available bandwidth, therefore making it a great video experience on both mobile networks as well as Wi-Fi internet connections. Our video is optimized to play on mobile networks with inconsistent throughput so that our users don\'t have to compromise on their experience on the low end, and play HD quality video on the top end of bandwidth availability. Additionally, our users can manually select the quality of video that suits their taste. Content search on Cinemasthan has been optimized to reduce complexity and delay in accessing content. Accurate search results, with lightning-fast, autocomplete suggestions navigate users to video with minimal navigation friction and ease of use.\r\n\r\nContent organization on Cinemasthan is a result of a thoughtful user experience approach and strong design principles that ensure that the user is not overwhelmed with the breadth of content available. Using a mix of algorithms and human curation, users at any stage of their interaction with Cinemasthan will discover various content and see their experience evolve with their interaction patterns over time.\r\n\r\nCinemasthan not only offers the latest and popular movies and knowledge-based content but also helps the young and the new filmmakers by providing them a global platform from the Indian subcontinent and the world. \r\n\r\nAccess \r\nCinemasthan can be accessed on the web at www.cinemasthan.com. Cinemasthan will be available soon on the Google Play Store &amp; Apple App Store for mobile and tablet applications. It will also available on Apple TV, Android TV.\r\n\r\nIf you have any queries please do contact us below our Head Office :\r\n\r\nCINEMASTHAN\r\nRIFF FILM CLUB\r\n406, 4th Floor, \"GURU-KRIPA TOWER\" , C-43,\r\nMahaveer Marg. C-Scheme, JAIPUR - 302001 (Raj.)  INDIA\r\nEmail : info@cinemasthan.com \r\n', 'Cinemasthan About Us - The Real Cinema of Rajasthan | Watch Rajasthani Movies Online | Movies Online | OTT Movies , Rajasthan,INDIA', 'Cinemasthan About Us - The Real Cinema of Rajasthan | Watch Rajasthani Movies Online | Movies Online | OTT Movies , Rajasthan,INDIA', 'Cinemasthan About Us - The Real Cinema of Rajasthan | Watch Rajasthani Movies Online | Movies Online | OTT Movies , Rajasthan,INDIA', 'index, follow', '27_07_2021_16_24_41_pm.jpg', 0, 1, 'About Us', 'Your Dashboard', NULL, NULL, NULL, NULL, '1629016080'),
