(30, '1,4', 'Paid', 'Maans', 'maans', 'Prakash Ghai', 'Prakash Ghai', '2020', 'Rajasthani', 'U/A 16+', NULL, 31, 'Drama', NULL, '25', NULL, '\"This story is set on the borders of Haryana and Rajasthan. This is the story of an Ironsmith and the history of his family where women have always been used just as an instrument to harass sexually and mentally. Eating non-veg, drinking acohol and after that abusing your own wife is an everyday fashion there and due to which women have also accepted this lifestyle as their ife\'s fortune.\"', '585727997', '585409604', '18_08_2021_23_00_82_pm.webp', 1, '16_08_2021_18_00_14_pm.webp', '16_08_2021_18_04_20_pm.webp', 'Khushi Rajput Jha, Harshvardhan Kumar, Mohant Kant, Abha Balani, Kapil Koli, Yukti Bhanuka Chowdhary, Sanjay Sharma, Daisy Sondhi, Kuldeep Singh, Jayant Kataria', 'Watch Maans Movie Online |  Maans Movie Online | Maans Movie ', 'Watch Maans Movie Online |  Maans Movie Online | Maans Movie ', 'Watch Maans Movie Online |  Maans Movie Online | Maans Movie ', 0, 'index,follow', 1, '1628279070', '1629307861'),
(31, '1,6', 'Paid', 'Karma Bai', 'karma-bai', 'U.K.G. (TANDOO)', 'U.K.G. (TANDOO)', '1980', 'Rajasthani', 'U', 2, 30, 'Drama', NULL, '20', NULL, 'Karmabai\'s father was a devotee of Krishna. Once he had to do some work away from home, so he instructed Karmabai to have food only after offering the food (bhog) to the lord. Karma was very young and she took this instruction literally. Next morning she woke up early and made khichdi for offering it to the Lord. ', '588388033', '585427826', '22_08_2021_00_43_17_am.webp', 1, '16_08_2021_17_52_27_pm.webp', '22_08_2021_00_43_70_am.webp', 'Dilip Dhawan, Meera Madhuri, Anup Jalota Anita Gupta', 'Watch Karma Bai Movie Online |  Karma Bai Movie Online | Karma Bai Movie ', 'Watch Karma Bai Movie Online |  Karma Bai Movie Online | Karma Bai Movie ', 'Watch Karma Bai Movie Online |  Karma Bai Movie Online | Karma Bai Movie ', 0, 'index,follow', 1, '1628280596', '1629573228'),
(32, '5', 'Paid', 'Tara Ri Chundari', 'tara-ri-chundari', 'JP Choudhary ', 'Madhu Bhat', '2021', 'Rajasthani', 'U/A 13+', NULL, 5, 'Music', NULL, '20', NULL, 'The song was written by Dhanraj Dadhich and sung by Madhu Bhat. This song is based on Rajasthani folk tradition where wife (lover) gets jealous watching other ladies wearing special watching other ladies wearing special \'chunadi with tara\' ..means special embroidered scarf. She asks her beloved to bring her the same when he visits the big town. She persuades him through various means to yield to her demand. In the end of the song ends with the beloved bringing the same to her and suprising her lovingly. ', '585844604', '585398048', '18_08_2021_22_58_64_pm.webp', 0, '16_08_2021_17_44_90_pm.webp', '16_08_2021_17_44_77_pm.webp', 'Madhu Bhat, Pankaj Kumar ', 'Watch Tara Ri Chundari Movie Online |  Tara Ri Chundari Movie Online | Tara Ri Chundari Movie ', 'Watch Tara Ri Chundari Movie Online |  Tara Ri Chundari Movie Online | Tara Ri Chundari Movie ', 'Watch Tara Ri Chundari Movie Online |  Tara Ri Chundari Movie Online | Tara Ri Chundari Movie ', 0, 'index,follow', 1, '1628341081', '1629440339'),
(33, '5', 'Paid', 'Goriya', 'goriya', 'Raperriya Balam', 'Honey Trouper and Gaurav Jain', '2021', 'Rajasthani', 'U/A 13+', 0, 4, 'Music', NULL, '15', NULL, 'The song was written by Rajneesh Jaipuri and sung by Gaurav Jain & Deepshikha Jain. This Music Video is a romantic Rajasthani number by Trouper records featuring international singing duo Dr. Gaurav Jain & Deepshikha Jain. Based on the famous Rajasthani folk tune the concept is presented in a contemporary style by Rapperiya baalam, lyrics by Rajnish Jaipuri. The video has an emotional touch where an army man\'s wife is imagining her spouse in festivals like karwa chauth. ', '585816395', '585389380', '18_08_2021_22_56_84_pm.webp', 0, '16_08_2021_17_42_19_pm.webp', '16_08_2021_17_42_38_pm.webp', 'Honey Trouper, Kashish Bhatia', 'Watch Goriya Movie Online |  Goriya Movie Online | Goriya Movie ', 'Watch Goriya Movie Online |  Goriya Movie Online | Goriya Movie ', 'Watch Goriya Movie Online |  Goriya Movie Online | Goriya Movie ', 0, 'index,follow', 1, '1628342308', '1629440391'),
(34, '5', 'Paid', 'Chaal Aapa Chaala', 'chaal-aapa-chaala', 'Aanand Singh Chauhan', 'DS Chouhan, Shanti Lal Chopra', '2021', 'Rajasthani', 'U/A 13+', 0, 6, 'Music', NULL, '20', NULL, 'The Lyrics Concept Direction was given by Anand Singh Chouhan and the song was sung by Deepak Panwar. This is a romantic song in Rajasthani language. In this song, present the romantic feeling of Rajasthani coupe with rich culture. Its a beautiful and soulful song picturised at Real Rajasthani locations. ', '585821547', '585820037', '18_08_2021_22_53_89_pm.webp', 0, '16_08_2021_17_36_56_pm.webp', '16_08_2021_17_36_96_pm.webp', 'Swati Jangid, Naveen Borana, Naveen Ratawa', 'Watch Chaal Aapa Chaala Movie Online |  Chaal Aapa Chaala Movie Online | Chaal Aapa Chaala Movie ', 'Watch Chaal Aapa Chaala Movie Online |  Chaal Aapa Chaala Movie Online | Chaal Aapa Chaala Movie ', 'Watch Chaal Aapa Chaala Movie Online |  Chaal Aapa Chaala Movie Online | Chaal Aapa Chaala Movie ', 0, 'index,follow', 1, '1628343018', '1629886810'),
(35, '1,8', 'Paid', 'Shubh Raatri', 'shubh-raatri', 'Pankaz Singh Tanwar', 'Pankaz Singh Tanwar', '2021', 'Hindi', 'U/A 16+', 0, 52, 'Horror', NULL, '25', NULL, 'It is a story about the finding of the truth of a witch which is only heard in tales by people living near village. Some friends find this tale interesting and try to enter the village but are stopped by the villagers. Are they able to enter the village? Are they able to find the \r\ntruth? Is the tale of the witch true? Shubh Raatri is all about finding the truth.', '585717931', '585333645', '16_08_2021_17_33_67_pm.webp', 1, '16_08_2021_17_34_69_pm.webp', '16_08_2021_17_35_43_pm.webp', 'Priya Gupta, Afzal Hussain, Avinash Kumar, Jitendra Singh Rajpurohit, \r\nSimran Ahmed, Jaya Goswami, Kuldeep Rawal, Shishir Sinha, Sharad Sharma, Nemi Chand & Pukhraj Suthar.', 'Watch Shubh Raatri Movie Online |  Shubh Raatri Movie Online | Shubh Raatri Movie ', 'Watch Shubh Raatri Movie Online |  Shubh Raatri Movie Online | Shubh Raatri Movie ', 'Watch Shubh Raatri Movie Online |  Shubh Raatri Movie Online | Shubh Raatri Movie ', 0, 'index,follow', 1, '1628349472', '1629213357'),
(36, '9', 'Paid', 'Broken Ambitions: Expectations or A Murder??', 'broken-ambitions-expectations-or-a-murder', 'Eshan Harsh', 'Eshan Harsh', '2017', 'Hindi', 'U/A 13+', 0, 8, 'Drama', NULL, '1', NULL, 'The Story of the short film “ Broken Ambitions “ revolves around an ordinary High School student named Hitesh who also beings the protagonist succumbs to the pain caused by his own kin and decides to get rid of his torturous life. This Film reflects the repercussions of the “ Imposition of Dreams and Expectations “ by few parents on their progeny which sometimes going overboard leads to suicide which can also be put in other words as a “ Murder “ !!!  ', '592113292', '585354450', '18_08_2021_22_16_68_pm.webp', 0, '16_08_2021_17_31_91_pm.webp', '16_08_2021_17_31_21_pm.webp', 'Anshul K Panicer, Saumya Holani, Anmol Bhat, Hitesh Harsh, Vedant Arora, Sankalp Bhardwaj', 'Watch Broken Ambitions: Expectations or A Murder?? Movie Online |  Broken Ambitions: Expectations or A Murder?? Movie Online | Broken Ambitions: Expectations or A Murder?? Movie ', 'Watch Broken Ambitions: Expectations or A Murder?? Movie Online |  Broken Ambitions: Expectations or A Murder?? Movie Online | Broken Ambitions: Expectations or A Murder?? Movie ', 'Watch Broken Ambitions: Expectations or A Murder?? Movie Online |  Broken Ambitions: Expectations or A Murder?? Movie Online | Broken Ambitions: Expectations or A Murder?? Movie ', 0, 'index,follow', 1, '1628350074', '1629889468'),
