(82, '9', 'Paid', 'Khat', 'khat', 'Deepanshu Sehgal', 'Vipin Kumar Sehgal', '2019', 'Hindi', 'U/A 13+', 0, 19, 'Drama,Romance', NULL, '20', NULL, 'A one sided love story, where the relationship is not accepted, nor expected by the society. Dhriti tries to know her lover with regular meeting and confesses herself.', '676744353', '676626406', '12_02_2022_23_40_41_pm.webp', 0, '12_02_2022_23_40_33_pm.jpg', '12_02_2022_23_40_81_pm.webp', 'Himanee Bhatia, Sakshi Singh, Chiran Jeevv Madan', 'Watch Khat Movie Online |  Khat Movie Online | Khat Movie ', 'Watch Khat Movie Online |  Khat Movie Online | Khat Movie ', 'Watch Khat Movie Online |  Khat Movie Online | Khat Movie ', 0, 'index,follow', 1, '1644689568', '1653215969'),
(83, '1,11', 'Paid', 'Help', 'help', 'Jerrin Chandan', 'Aditya DN', '2022', 'Kannada', 'U/A 13+', 0, 30, 'Action ,Drama', NULL, '20', NULL, 'The film is about the importance to help in today\'s world on the basis of humanitarian grounds. The story drives very interestingly on providing education to the needy & discouraging child labour in today\'s world making lives more meaningful. Conveying that education & life is first priority. Money earning comes after that according to the respective age. The story revolves with a chemistry between christian non and a boy named Raju with an emotional climax.', '712741167', '712574673', '22_05_2022_16_23_65_pm.webp', 0, '22_05_2022_16_23_79_pm.webp', '22_05_2022_16_23_82_pm.webp', 'Beesu Suresh, Abhijith Rao, Veena Sundar, Swathi, DN Aditya, Nisha Yash Ram', 'Watch Help Movie Online |  Help Movie Online | Help Movie ', 'Watch Help Movie Online |  Help Movie Online | Help Movie ', 'Watch Help Movie Online |  Help Movie Online | Help Movie ', 0, 'index,follow', 1, '1653214287', '1653288713'),
(84, '1,9', 'Paid', 'No Goodbyes', 'no-goodbyes', 'Rutika Nikam', 'Akash Anil Sonawane, Ishan Salunkhe', '2022', 'Hindi', 'U/A 16+', 0, 8, 'Drama,Horror', NULL, '20', NULL, 'No Goodbyes is a Horror - Mystery snippet about a maid and a lady. It revolves around an unraveling drama between them. It is set in a tense ambiance of a House enchanted by the presence of the maid.', '713151770', '712575355', '22_05_2022_16_24_15_pm.webp', 0, '22_05_2022_16_25_43_pm.webp', '22_05_2022_16_25_48_pm.webp', 'Sanika Gaikwad, Anushka Khode', 'Watch No Goodbyes Movie Online |  No Goodbyes Movie Online | No Goodbyes Movie ', 'Watch No Goodbyes Movie Online |  No Goodbyes Movie Online | No Goodbyes Movie ', 'Watch No Goodbyes Movie Online |  No Goodbyes Movie Online | No Goodbyes Movie ', 0, 'index,follow', 1, '1653214741', '1653544558'),
(85, '1,9', 'Paid', 'Roomates', 'roomates', 'Himanee Bhatia', 'Himanee Bhatia', '2020', 'Hindi', 'U/A 16+', 0, 8, 'Drama,Horror', NULL, '20', NULL, 'A young girl hears strange noises and has supernatural experiences. She calls a mysterious friend.Tara to come by to help her out. Through the film we discover how past experiences often make the scariest stories.', '713159041', '712575768', '24_05_2022_12_36_30_pm.webp', 0, '22_05_2022_16_26_55_pm.webp', '22_05_2022_16_26_89_pm.webp', 'Himanee Bhatia', 'Watch Roomates Movie Online |  Roomates Movie Online | Roomates Movie ', 'Watch Roomates Movie Online |  Roomates Movie Online | Roomates Movie ', 'Watch Roomates Movie Online |  Roomates Movie Online | Roomates Movie ', 0, 'index,follow', 1, '1653215410', '1653587364'),
(86, '12', 'Paid', 'Dhinga Gavar', 'dhinga-gavar', 'Somendra Harsh', 'Somendra Harsh', '2022', 'Rajasthani', 'U', 0, 30, 'Family ,Religions', NULL, '20', NULL, 'This short documentary is about the Dhinga Gavar Festival which only takes place in the city of Jodhpur, Rajasthan during the Chitra month according to the Hindu Calendar.  This documentary showcases the history of the festival along with its mythological as well as spiritual aspects of it. The Documentary also highlights various facts about this festival, one of them being that even widows can take part in the celebrations which is not the case with many Hindu celebrations involving women or otherwise.\r\n\r\nDuring Dhinga Gavar , women worship the statues of Shiva (Isar) and his consort Parvati (Gangaur) to seek blessings for marital bliss. According to popular belief, any unmarried man coming near these women to get struck by the stick during Dhinga gavar gets married soon to a suitable girl. Women also dress up getting inspired from the mythological characters, dacoits, police, etc.', '', '754832645', '06_10_2022_21_56_92_pm.webp', 1, '06_10_2022_21_56_70_pm.webp', '06_10_2022_21_56_81_pm.webp', '', 'Watch Dhinga Gavar Movie Online |  Dhinga Gavar Movie Online | Dhinga Gavar Movie ', 'Watch Dhinga Gavar Movie Online |  Dhinga Gavar Movie Online | Dhinga Gavar Movie ', 'Watch Dhinga Gavar Movie Online |  Dhinga Gavar Movie Online | Dhinga Gavar Movie ', 0, 'index,follow', 1, '1665073660', '1665073660');
